            "fontSize": 9.239882003864116,
            "fontFamily": 1,
            "text": "Okay, imagine you have a shiny new toy – let's call it the Bitcoin \nToy Box. Now, there's a big playground where everyone comes to show \noff and trade their toys, which we'll call the Nasdaq Playground.\n\nOne day, the people who take care of the Bitcoin Toy Box decided they\nwanted to share it with friends on the Nasdaq Playground. But to do \nthat, they need to ask the Playground Bosses, a group we'll call the \nSEC, for permission.\n\nThey wrote a letter on June 29th asking, \"May we bring our Bitcoin \nToy Box to the playground?\" This letter was like asking if they could\nmake a special spot on the playground for their toy.\n\nIn July, the Playground Bosses put up a big notice on their wall for \neveryone to see. They asked all the kids and adults, \"What do you \nthink about having the Bitcoin Toy Box here?\" People could write back\nwith their thoughts.\n\nA couple of months later, at the end of August, the Playground Bosses\nsaid, \"Hmm, we need some more time to think about this.\" They decided\nthey would take a little longer to make up their minds. They were \nthinking, \"Should we let this toy come play here or not?\" They told \neveryone they would decide by October 17th.\n\nSo now, they are taking some special thinking time to make a good \ndecision about whether to say \"Yes\" to the Bitcoin Toy Box and let it\njoin the playground fun or to say \"No\" and tell it that it can't join\nright now.\n\n\n\n\n\n\n",
            "textAlign": "center",
            "verticalAlign": "middle",
            "containerId": "e8OIByc5RWtOHxgRHBaEg",
            "originalText": "Okay, imagine you have a shiny new toy – let's call it the Bitcoin Toy Box. Now, there's a big playground where everyone comes to show off and trade their toys, which we'll call the Nasdaq Playground.\n\nOne day, the people who take care of the Bitcoin Toy Box decided they wanted to share it with friends on the Nasdaq Playground. But to do that, they need to ask the Playground Bosses, a group we'll call the SEC, for permission.\n\nThey wrote a letter on June 29th asking, \"May we bring our Bitcoin Toy Box to the playground?\" This letter was like asking if they could make a special spot on the playground for their toy.\n\nIn July, the Playground Bosses put up a big notice on their wall for everyone to see. They asked all the kids and adults, \"What do you think about having the Bitcoin Toy Box here?\" People could write back with their thoughts.\n\nA couple of months later, at the end of August, the Playground Bosses said, \"Hmm, we need some more time to think about this.\" They decided they would take a little longer to make up their minds. They were thinking, \"Should we let this toy come play here or not?\" They told everyone they would decide by October 17th.\n\nSo now, they are taking some special thinking time to make a good decision about whether to say \"Yes\" to the Bitcoin Toy Box and let it join the playground fun or to say \"No\" and tell it that it can't join right now.\n\n\n\n\n\n\n",
